apiVersion: training.eduk8s.io/v1alpha2
kind: Workshop
metadata:
  name: end-to-end-workshop
spec:
  title: End to End Workshop
  description: A workshop exploring the end to end experience of VMware Tanzu
  vendor: tanzu.vmware.com
  difficulty: beginner
  duration: 30m
  url: https://github.com/tanzu-end-to-end/end-to-end-workshop
  logo: data:image/png;base64,
  content:
    #image: quay.io/eduk8s/lab-markdown-sample:master
    files: github.com/tanzu-end-to-end/end-to-end-workshop
  session:
    namespaces:
      budget: small
    applications:
      terminal:
        enabled: true
        layout: split
      console:
        enabled: true
      editor:
        enabled: true
